import React from 'react';

const BudgetTracker = () => {
  return (
    <div className="p-4">
      <h2 className="text-2xl font-bold mb-4">Budget Tracker</h2>
      <p>Budget tracking functionality will be implemented here.</p>
    </div>
  );
};

export default BudgetTracker;
